import React from "react";
import PropTypes from "prop-types";
import YearCreate from "./YearCreate.module.css";
import AllGradeList from "./listAllGrades/AllGradeList";

const GradeListContainer = ({ schoolYear }) => {
  return (
    <div className={YearCreate.year_list_container}>
      <div className={YearCreate.grade_list_form}>
        <div className={YearCreate.year_create_title}>Класове</div>
        <div>
          <AllGradeList title={"Начален етап"} schoolYear={schoolYear.juniorSchool} grades={[1,2,3,4]}/>
        </div>
        <div>
          <AllGradeList title={"Прогимназия"} schoolYear={schoolYear.interSchool} grades={[1,2,3,4]}/>
        </div>
        <div>
          <AllGradeList title={"Гимназиален курс"} schoolYear={schoolYear.highSchool} grades={[1,2,3,4]}/>
        </div>
      </div>
    </div>
  );
};

GradeListContainer.propTypes = {};

export default GradeListContainer;
